import React from "react";
import "./Nav.css";
import Logo from "./logo/Netflix_Logo_RGB.png";

function Nav() {
  return (
    <div className="nav">
      <img src={Logo} alt="Netflix Logo" className="nav__logo" />
      <img src={Logo} alt="Netflix Logo" className="nav__avatar" />
    </div>
  );
}

export default Nav;
